&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;Strengthening the muscles around the knee is not the answer to knee pain reduction.&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;If you or a loved one is experiencing hip or knee pain, you won&#039;t want to miss this special event. This is an interactive workshop where you will perform the exercises while sitting at your computer.&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;You will learn:&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;&bull; Non-invasive methods to reduce Arthritis discomforted&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;&bull; Climb stairs take walks and go dancing without pain&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;&bull; Avoid surgery, cortisone and drugs. Take charge of your knee health&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;The program &quot;Knee Pain Recipe&quot; was created by a personal trainer who had been in pain for over15 years. It&#039;s a 6 step system design to reduce knee pain and return you to an active life.&lt;/p&gt;
&lt;p style=&quot;margin:0px;color:#6f7287;font-size:16px;&quot;&gt;Host: Renee Moten&lt;/p&gt;
